import React , {useState}from "react";
import ReactDOM from "react-dom";
import styled from "styled-components"

import  WeekSchedular  from "./components/WeekSchedular";
import ModalCalendar from "./components/ModalCalender";

const StyledWeekCalendar = styled(WeekSchedular)`
  margin: 50px;
`;

const App = () => {
 const[state,setState] = useState({
    weekCalendar: true
  });
  const toggleLibrary = () => {
    setState({
      weekCalendar: !state.weekCalendar
    });
  };
  return <WeekSchedular useModal={true} modalComponent={() => {
    return <ModalCalendar />;
  }} />;
};

const rootElement = document.getElementById("root");
ReactDOM.render(<StyledWeekCalendar />, rootElement);
